import React from "react";

function SocialLinks() {
    const socialLinks = [
        {
            name: "Facebook",
            icon: "/path/to/facebook-icon.png",
            url: "https://facebook.com",
        },
        {
            name: "LinkedIn",
            icon: "/path/to/linkedin-icon.png",
            url: "https://linkedin.com",
        },
        {
            name: "Twitter",
            icon: "/path/to/twitter-icon.png",
            url: "https://twitter.com",
        },
    ];

    return (
        <nav className="flex flex-col mt-6 w-full max-md:max-w-full">
            <h2 className="font-semibold text-white max-md:max-w-full">
                Follow us:
            </h2>
            <ul className="flex gap-4 mt-2">
                {socialLinks.map((link, index) => (
                    <li key={index}>
                        <a
                            href={link.url}
                            target="_blank"
                            rel="noopener noreferrer"
                            aria-label={`Visit our ${link.name} page`}
                        >
                            <img
                                src={link.icon}
                                alt={`${link.name} icon`}
                                className="w-8 h-8"
                            />
                        </a>
                    </li>
                ))}
            </ul>
        </nav>
    );
}

export default SocialLinks;
